tables.table_schema:
CREATE TABLE ProteinExpressionStudies (
    experiment_id INT PRIMARY KEY,
    sample_id INT,
    protein_name VARCHAR(255),
    expression_level FLOAT
);

CREATE TABLE BiopharmaceuticalDevelopment (
    sample_id INT PRIMARY KEY,
    drug_name VARCHAR(255),
    efficacy FLOAT,
    toxicity FLOAT
);

CREATE TABLE Proteins (
    protein_id UUID PRIMARY KEY,
    protein_name VARCHAR(255),
    expression_level FLOAT,
    source_id UUID
);

CREATE TABLE Studies (
    study_id UUID PRIMARY KEY,
    study_name VARCHAR(255),
    researcher_name VARCHAR(255),
    study_date DATE
);

CREATE TABLE Results (
    result_id UUID PRIMARY KEY,
    sample_id UUID,
    measurement FLOAT,
    significance BOOLEAN
);

CREATE TABLE ProteinSamples (
    sample_id INT PRIMARY KEY,
    sample_name VARCHAR(255),
    expression_level FLOAT
);

CREATE TABLE GeneInformation (
    gene_id INT PRIMARY KEY,
    gene_name VARCHAR(255),
    gene_sequence TEXT
);

CREATE TABLE ExperimentalConditions (
    condition_id INT PRIMARY KEY,
    condition_description TEXT
);

CREATE TABLE StudyParticipants (
    participant_id INT PRIMARY KEY,
    participant_name VARCHAR(255),
    participant_role VARCHAR(50)
);
